function [lambda, l] =  solver_rect_cos_32_baseline(x123,s123,c123,x45,s45,c45)
% x123 contains the first the points which are in correspondence
% and x45 contains the fourth and fifth point which are in correspondence
% so x123(:,1) <-> x123(:,2) <-> x123(:,3) and x45(:,1) <-> x45(:,2)
% Don't ask me why I chose this naming convention...
% size(x123) = [2 3], size(x45) = [2 2]


if size(x123,1) == 3
    x123 = x123(1:2,:);
    x45 = x45(1:2,:);
end

% Rescale the scale
s123 = s123 ./ mean(abs(s123));
s45 = s45 ./ mean(abs(s45));


data = [x123 x45];
d = sum(data(1:2,:).^2);

% Rescale line and lambda unknowns
scale_line = mean(abs(data(1:2,:)),2);
scale_lambda = mean(d);

data(1:2,:) = diag(1./scale_line)*data(1:2,:);
data = [data; s123 s45; c123 c45; d / scale_lambda];

sols = solve(data);

sols = real(sols(:,max(abs(imag(sols)))<1e-6));

% Revert rescaling
lambda = sols(1,:) / scale_lambda;
l = diag(1./scale_line) * sols(2:3,:);


